    'parent' => 5013,
    'isfolder' => 0,
    'introtext' => '',
    'content' => '<div>ФНС России подготовила проект приказа об утверждении формы и формата представления налоговой декларации по земельному налогу в электронной форме и порядка ее заполнения.<br />В соответствии с пунктом 7 статьи 80 Налогового кодекса Российской Федерации, в целях реализации положений главы 31 «Земельный налог» части второй Налогового кодекса Российской Федерации п р и к а з ы в а ю:<br />1. Утвердить:<br />форму налоговой декларации по земельному налогу согласно приложению № 1 к настоящему приказу;<br />формат представления налоговой декларации по земельному налогу в электронном виде согласно приложению № 2 к настоящему Приказу;<br />Порядок заполнения налоговой декларации по земельному налогу согласно приложению № 3 к настоящему Приказу.<br />2. Признать утратившими силу:<br />приказ ФНС России от 28.10.2011№ ММВ-7-11/696 «Об утверждении формы и формата представления налоговой декларации по земельному налогу в электронном виде и порядка ее заполнения» (зарегистрирован Министерством юстиции Российской Федерации 09.12.2011, регистрационный номер 22530);<br />п. 10 приказа ФНС России от 14.11.2013 № ММВ-7-3/501@ «О внесении изменений в приказы ФНС России».<br />3. Настоящий Приказ вступает в силу по истечении двух месяцев со дня его официального опубликования и применяется начиная с представления налоговой декларации по земельному налогу за налоговый период 2017 года.<br />4. Руководителям (исполняющим обязанности руководителя) управлений Федеральной налоговой службы по субъектам Российской Федерации довести настоящий приказ до нижестоящих налоговых органов и обеспечить его применение.<br />5. Контроль за исполнением настоящего приказа возложить на заместителя руководителя Федеральной налоговой службы, координирующего методологическое обеспечение работы налоговых органов по вопросам исчисления, полноты и своевременности внесения в бюджетную систему Российской Федерации налога на имущество организаций, земельного налога, транспортного налога, налога на имущество физических лиц.</div>',
